import Paper from '@material-ui/core/Paper';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import WillitendService from '../services/Willitend.service.js';
import React, { useState ,useEffect} from 'react';
import { makeStyles } from '@material-ui/core/styles';
const useStyles = makeStyles({
  table: {
    width: '100%',
    display: 'grid', 
    justifyContent: 'center', 
    alignItems: 'center',
  }
});
const map = {
  "AL": "Alabama",
  "AK" : "Alaska",
  "AS" : "American Samoa",
  "AZ" : "Arizona",
  "AR" : "Arkansas",
  "AA" : "Armed Forces Americas",
  "AE" : "Armed Forces Europe",
  "AP" : "Armed Forces Pacific",
  "CA" : "California",
  "CO" : "Colorado",
  "CT" : "Connecticut",
  "DE" : "Delaware",
  "DC" : "District Of Columbia",
  "FL" : "Florida",
  "GA" : "Georgia",
  "GU" : "Guam",
  "HI" : "Hawaii",
  "ID" : "Idaho",
  "IL" : "Illinois",
  "IN" : "Indiana",
  "IA" : "Iowa",
  "KS" : "Kansas",
  "KY" : "Kentucky",
  "LA" : "Louisiana",
  "ME" : "Maine",
  "MH" : "Marshall Islands",
  "MD" : "Maryland",
  "MA" : "Massachusetts",
  "MI" : "Michigan",
  "MN" : "Minnesota",
  "MS" : "Mississippi",
  "MO" : "Missouri",
  "MT" : "Montana",
  "NE" : "Nebraska",
  "NV" : "Nevada",
  "NH" : "New Hampshire",
  "NJ" : "New Jersey",
  "NM" : "New Mexico",
  "NY" : "New York",
  "NC" : "North Carolina",
  "ND" : "North Dakota",
  "NP" : "Northern Mariana Islands",
  "OH" : "Ohio",
  "OK" : "Oklahoma",
  "OR" : "Oregon",
  "PA" : "Pennsylvania",
  "PR" : "Puerto Rico",
  "RI" : "Rhode Island",
  "SC" : "South Carolina",
  "SD" : "South Dakota",
  "TN" : "Tennessee",
  "TX" : "Texas",
  "VI" : "US Virgin Islands",
  "UT" : "Utah",
  "VT" : "Vermont",
  "VA" : "Virginia",
  "WA" : "Washington",
  "WV" : "West Virginia",
  "WI" : "Wisconsin",
  "WY" : "Wyoming"
}


export default function Textfield (props) {
  const classes = useStyles();
  const state = props.place; 
  const statesData = props.statesData;
  const [stateInfo, setStatInfo] = useState([]);
  var is_load_failed = false;
  var is_load = false;
  useEffect(() => {
    if(!is_load || is_load_failed){
      WillitendService.getAllStateInfo()
      .then(return_data =>{
      setStatInfo(return_data.data)
      })
      .catch(err=>{
        alert(err);
        is_load_failed = true;
        console.log("Unable to Loaded");
        }
      );
      console.log("Textfiled State Data has been loaded!");
    }
    else{
      createData(state);
    }
  }, [state]);

var rows = createData(state);
function createData(state) {
  console.log("Here!!!");
  if(!is_load_failed || state===""){
    return [
      ["Days to Herd Immunity","N/A"],
      ["Citizens Currently Vaccinated (Fully)","N/A"],
      ["Citizens Currently Vaccinated (Partially)","N/A"],
      ["Vaccinations Per Day","N/A"]
    ];
  }
  else{
    for(var i = 0;i<stateInfo.length;i++){
      if(state === stateInfo[i].name){
        return [
          ["Days to Herd Immunity",stateInfo[i].hdays],
          ["Citizens Currently Vaccinated (Fully)",stateInfo[i].firstShot],
          ["Citizens Currently Vaccinated (Partially)",stateInfo[i].firstShot],
          ["Vaccinations Per Day",stateInfo[i].vacPerDay]
        ];
      }
    }
  }
}

  return (
    <TableContainer component = {Paper}>
      <Table className={classes.table} aria-label="COVID-19 Vaccine Results Table">
        <TableHead>
        {state !== "" && 
          <h1>State of {map[state]} Vaccine Results </h1>
        }
        {state === "" &&
          <h3>Vaccine Results</h3>
        }
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow key={row[0]}>
              <TableCell component="th" scope="row">
                {row[0]}
              </TableCell>
              <TableCell align="right">{row[1]}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
